// HybridImageDiagram.js
import React from 'react';
import ReactFlow from 'reactflow';
import 'reactflow/dist/style.css';

function HybridImageDiagram() {
  const elements = [
    { id: '1', data: { label: 'Image A' }, position: { x: 100, y: 50 } },
    { id: '2', data: { label: 'High Pass Filter' }, position: { x: 100, y: 150 } },
    { id: '3', data: { label: 'Image B' }, position: { x: 300, y: 50 } },
    { id: '4', data: { label: 'Low Pass Filter' }, position: { x: 300, y: 150 } },
    { id: '5', data: { label: 'Hybrid Image' }, position: { x: 200, y: 300 } },
    { id: 'e1-2', source: '1', target: '2', type: 'smoothstep' },
    { id: 'e3-4', source: '3', target: '4', type: 'smoothstep' },
    { id: 'e2-5', source: '2', target: '5', type: 'smoothstep' },
    { id: 'e4-5', source: '4', target: '5', type: 'smoothstep' },
  ];

  return (
    <div style={{ height: '400px' }}>
      <ReactFlow elements={elements} />
    </div>
  );
}

export default HybridImageDiagram;
